import Grid from '@mui/material/Grid'
import Paper from '@mui/material/Paper'
import Apps from './Apps'

function AppBox() {

  return (
    <Grid container spacing={2} justifyContent="center" display="flex" sx={{ pt: 2 }}>
          <Grid container spacing={2} justifyContent="center" display="flex" sx={{ pt: 2 }}>
            <Apps title='qwe' />
          </Grid>
    </Grid>
  )
}

export default AppBox;
